import React from "react";
import { StyleSheet, css } from "aphrodite";
import Header from "../components/Header/Header";

const About = () => {
	return (
		<div className={css(classes.root)}>
			<Header />
			<div className={css(classes.container)}>
				<span className={css(classes.title)}></span>
				<div className={css(classes.contents)}>
					<div className={css(classes.image)}></div>
					<span className={css(classes.description)}></span>
				</div>
				<div className={css(classes.icon)}></div>
			</div>
		</div>
	);
};

const classes = StyleSheet.create({
	root: {},
});

export default About;
